#include <iostream>
#include <vector>

using namespace std;

class Solution
{
  public:

    bool searchMatrix(vector<vector<int>>& matrix, int target)
    {
        this->matrix = &matrix;
        this->target = target;

        int rowIndex = getRowIndex( target );

        if ( rowIndex < 0 )
            return true;

        this->index = rowIndex;
        return hasRowNumber();
    }

  private:

    int findRow( int up, int down )
    {
        if ( up == down )
            return up;

        int center = up + ((down - up) >> 1);

        if ( up + 1 == down )
        {
            if ( target < (*matrix)[down][0] )
                return up;
            else
                return down;
        }

        int value = (*matrix)[center][0];

        if ( target < value )
        {
            return findRow( up, center );
        }
        else if ( target > value )
        {
            return findRow( center, down );
        }
        else
        {
            return -1;
        }
    }

    bool findValue( int left, int right )
    {
        int center = left + ((right - left) >> 1);
        int value = (*matrix)[index][center];

        if ( target < value )
        {
            if ( left == center )
                return false;
            return findValue( left, center );
        }
        else if ( target > value )
        {
            if ( center + 1 == right )
                return false;
            return findValue( center + 1, right );
        }
        else
        {
            return true;
        }
    }

    int getRowIndex( int number )
    {
        return findRow( 0, matrix->size() - 1 );

        /*
        for ( int i = matrix->size() - 1; i >= 0; --i )
        {
            if ( number >= (*matrix)[i][0] )
                return i;
        }
        */

        return 0;
    }

    bool hasRowNumber()
    {
        return findValue( 0, (*matrix)[0].size() );

        /*
        for ( int i = 0; i < (*matrix)[0].size(); ++i )
        {
            if ( number == (*matrix)[index][i] )
                return true;
        }
        */

        return false;
    }

    vector<vector<int>>* matrix;
    int target;
    int index;

};

